In the figure below, $ABDC,$ $EFHG,$ and $ASHY$ are all squares; $AB=EF =1$ and $AY=5$.

What is the area of quadrilateral $DYES$?

[asy]
size(5cm);
defaultpen(black+1);
pair a=(0,5); pair b=(1,5); pair c=(0,4); pair d=(1,4); pair e=(4,1); pair f=(5,1); pair g=(4,0); pair h=(5,0); pair y=(0,0); pair s=(5,5);
draw(a--s--h--y--a);
draw(c--d--b,gray);
draw(g--e--f,gray);
draw(d--y--e--s--d);
dot(a); dot(b); dot(c); dot(d); dot(e); dot(f); dot(g); dot(h); dot(y); dot(s);
label("$A$",a,NW);
label("$B$",b,N);
label("$C$",c,W);
label("$D$",d,SE);
label("$E$",e,NW);
label("$F$",f,E);
label("$G$",g,S);
label("$H$",h,SE);
label("$Y$",y,SW);
label("$S$",s,NE);
[/asy]

In the figure shown, a perpendicular segment is drawn from B in rectangle ABCD to meet diagonal AC at point X.  Side AB is 6 cm and diagonal AC is 10 cm.  How many centimeters away is point X from the midpoint M of the diagonal AC?  Express your answer as a decimal to the nearest tenth.

[asy]
draw((0,0)--(25,0)--(25,15)--(0,15)--cycle,linewidth(1));
draw((0,0)--(25,15),linewidth(1));
draw((7.2,4.3)--(0,15),linewidth(1));
dot((12.5,7.5));
label("$M$",(12.5,7.5),N);
label("$A$",(0,0),S);
label("$B$",(0,15),N);
label("$C$",(25,15),N);
label("$D$",(25,0),S);
label("$X$",(7.2,4.3),SE);
[/asy]

How many squares have all four vertices on the 5 by 5 rectangular grid of dots below? Two such squares are displayed. [asy]
size(50);
for(int i = 0; i < 5; ++i){

for(int j = 0; j < 5; ++j){

dot((i,j));

}
}
draw((0,4)--(1,4)--(1,3)--(0,3)--cycle,linewidth(0.7));
draw((2,0)--(4,1)--(3,3)--(1,2)--cycle,linewidth(0.7));
[/asy]

Below is the graph of $y = a \csc bx$ for some positive constants $a$ and $b.$  Find $b.$

[asy]import TrigMacros;

size(500);

real g(real x)
{
	return 2*csc(x/3);
}

